(let [result (ms/nw-size ms/contacts t0 tmax :daily)
       dat {:day (mapcat keys (vals result))
            :count (mapcat vals (vals result))
            :label (apply concat (map (fn [[k v]] (repeat (count v) k)) result))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :label :color :label}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Size daily expansion"])]
      {:width 7 :height 6}))
