(let [result (ms/order ms/nodes t0 tmax :time)
       dat {:day (mapcat keys (vals result))
            :count (map :mean (mapcat vals (vals result)))
            :semin (mapv #(- (:mean %) (:sd %)) (mapcat vals (vals result)))
            :semax  (mapv #(+ (:mean %) (:sd %)) (mapcat vals (vals result)))
            :label (apply concat (map (fn [[k v]] (repeat (count (vals v)) k)) result))}]
(gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :label :color :label}]]
         [:geom_errorbar [:aes {:ymin :semin :ymax :semax }] {:width 0.68}]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Order daily expansion"])]
      {:width 7 :height 6}))
